// Analysis.js
import React from "react";
import Navigation from "./components/Navigation";
import Calculations from "./components/Calculations";

const Analysis = () => {
  return (
    <div>
      <div className="navigation-home">
        <Navigation />
      </div>{" "}
      <div className="calculations-home">
        <Calculations />
      </div>
    </div>
  );
};

export default Analysis;
